/**
 * @param {number[]} nums
 * @return {number}
 */
var missingInteger = function(nums) {
    // Sort the array to handle non-sequential and duplicate elements
    nums.sort((a, b) => a - b);

    let maxSequentialValue = nums[0];
    let sum = nums[0];
    let i = 1;
    while (i < nums.length) {
        // If the current number continues the sequence
        if (nums[i] === maxSequentialValue + 1) {
            sum += nums[i];
            maxSequentialValue = nums[i];
        }
        i++;
    }

    // After identifying the longest sequential prefix and its sum,
    // the missing integer is the next integer that is not in the array,
    // but since we are looking for the smallest missing integer greater than or equal
    // to the sum of the longest sequential prefix, we start from the sum itself.
    let missingInteger = sum;
    while (nums.includes(missingInteger)) {
        missingInteger++;
    }

    return missingInteger;
};
